import React,{useState,useEffect} from 'react';


function View(){

            const[users,setUsers]=useState([]);
            // const [editingUser,setEditingUser]=useState(null);

            const fetchUsers= async() =>{

                const result=await fetch ('http://localhost:5000/user');
                const data=result.json();
                setUsers(data);
            }; 

            useEffect(() =>{
                fetchUsers();
            },[]);

    return(
        <div>

            <table border="2">
                <thead>
                    <tr>
                        <th>Username</th>
                        <th>Email</th>
                        <th>Age</th>
                        
                    </tr>
                </thead>

                <tbody>
                    {users.map((user) => (

                    <tr key={user._id}>
                        <td>{user.username}</td>
                        <td>{user.email}</td>
                        <td>{user.dob}</td>
                    </tr>
                    
                    ))}
                </tbody>




            </table>

        </div>
    );
}
export default View;
